{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/dsptlp/attractiveness-bias-a-b-test?scriptVersionId=200452141\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"code","execution_count":1,"id":"fc791f9a","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2024-10-11T10:00:28.112433Z","iopub.status.busy":"2024-10-11T10:00:28.110167Z","iopub.status.idle":"2024-10-11T10:01:14.849944Z","shell.execute_reply":"2024-10-11T10:01:14.84719Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":46.754994,"end_time":"2024-10-11T10:01:14.853026","exception":false,"start_time":"2024-10-11T10:00:28.098032","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]},{"name":"stderr","output_type":"stream","text":["\n","Gmisc installed\n","\n"]}],"source":["options(warn = -1)\n","\n","# Define the specific library path and set it as the first library path globally\n","library_path <- .libPaths()[1]  # Or specify a custom path\n",".libPaths(library_path)          # Set the global library path\n","\n","# Check if 'pacman' is installed, and if not, install it in the specified library path.\n","if (!requireNamespace(\"pacman\", quietly = TRUE)) {\n","  install.packages(\"pacman\", lib = library_path, repos = \"https://cran.rstudio.com\")\n","}\n","\n","# Use 'pacman::p_load' to load or install the necessary packages.\n","pacman::p_load(\n","  dplyr, data.table, sandwich, lmtest, knitr, stargazer, ggplot2, patchwork, \n","  randomizr, AER, foreign, DiagrammeR, cobalt, magrittr, grid, htmlTable, \n","  glue, Gmisc, MatchIt, Hmisc, corrplot, PerformanceAnalytics, rcompanion,IRdisplay\n",")\n","\n","# Optionally disable the dplyr summarise messages\n","options(dplyr.summarise.inform = FALSE)\n","\n","library(data.table)\n","library(sandwich)\n","library(lmtest)\n","library(knitr)\n","library(stargazer)\n","library(randomizr)\n","library(foreign)\n","library(ggplot2)\n","library(AER)\n","library(\"readxl\")\n","library(DiagrammeR)\n","library(Gmisc, quietly = TRUE)\n","library(glue)\n","library(htmlTable)\n","library(grid)\n","library(magrittr)\n","library(cobalt)\n","library(MatchIt)\n","library(Hmisc)\n","library(corrplot)\n","library(PerformanceAnalytics)\n","library(rcompanion)\n","library(IRdisplay)\n","\n","knitr::opts_chunk$set(echo = TRUE)\n","options(digits = 3)\n","options(knitr.kable.NA = \"0\")\n","\n","input_file = '/kaggle/input/ab-test-linkedin-attractiveness-bias/1_FINAL_MASTER_TRACK.xlsx'\n","\n","get_details <- function(model_in, cluster_in = NULL, dependent_in = NULL) {\n","\n","  #Confidence Interval\n","  model_in$f_confint <- confint(model_in , level = 0.95)\n","  #vcovHC\n","  model_in$f_vcovHC <- vcovHC(model_in)\n","  \n","  #Robust Standard Error\n","  model_in$f_coeftest = coeftest(model_in, vcov. = model_in$f_vcovHC)\n","  \n","  #Robust Standard Error\n","  model_in$f_robust_er = sqrt(diag(model_in$f_vcovHC))\n","  \n","  #Confidence Interval with robust standard errors\n","  model_in$f_confint_re <- coefci(model_in , vcov = model_in$f_vcovHC)\n","  \n","  return(model_in)\n","    }"]},{"cell_type":"markdown","id":"9a2d8125","metadata":{"papermill":{"duration":0.00929,"end_time":"2024-10-11T10:01:14.872587","exception":false,"start_time":"2024-10-11T10:01:14.863297","status":"completed"},"tags":[]},"source":["# Attractiveness Bias\n","\n","## Research Question\n","How large of a role attractiveness plays in accepting a connection from a stranger in a professional network such as LinkedIn. Do acceptance rates of a fake profile with a more attractive picture differ from the otherwise same profile with a less attractive picture?\n","\n","The experiment will assess the hypothesis that the profile with a more attractive picture will have a statistically significantly higher connection rate than the profile with a less attractive picture.\n","\n","## Treatments\n","Apart from the pictures, the profiles had otherwise identical information: name, pronouns, location, professional experience, educational background, skills and interests. This minimizes the risk of any source of extraneous variation. They were based on real profiles to which individuals in the network of the group project members typically connect with, and built in order to sound as credible as possible.\n","\n","It follows below all the information we used to fill the profiles personal information in LinkedIn and that were visible to the participants receiving a connection request."]},{"cell_type":"code","execution_count":2,"id":"9a8ee9f0","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2024-10-11T10:01:14.92927Z","iopub.status.busy":"2024-10-11T10:01:14.89339Z","iopub.status.idle":"2024-10-11T10:01:14.960684Z","shell.execute_reply":"2024-10-11T10:01:14.958781Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":0.081449,"end_time":"2024-10-11T10:01:14.963376","exception":false,"start_time":"2024-10-11T10:01:14.881927","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"/9j/4AAQSkZJRgABAQEAYABgAAD/2wBDAAMCAgMCAgMDAwMEAwMEBQgFBQQEBQoHBwYIDAoM\nDAsKCwsNDhIQDQ4RDgsLEBYQERMUFRUVDA8XGBYUGBIUFRT/2wBDAQMEBAUEBQkFBQkUDQsN\nFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBT/wAAR\nCAHbA3QDASIAAhEBAxEB/8QAHwAAAQUBAQEBAQEAAAAAAAAAAAECAwQFBgcICQoL/8QAtRAA\nAgEDAwIEAwUFBAQAAAF9AQIDAAQRBRIhMUEGE1FhByJxFDKBkaEII0KxwRVS0fAkM2JyggkK\nFhcYGRolJicoKSo0NTY3ODk6Q0RFRkdISUpTVFVWV1hZWmNkZWZnaGlqc3R1dnd4eXqDhIWG\nh4iJipKTlJWWl5iZmqKjpKWmp6ipqrKztLW2t7i5usLDxMXGx8jJytLT1NXW19jZ2uHi4+Tl\n5ufo6erx8vP09fb3+Pn6/8QAHwEAAwEBAQEBAQEBAQAAAAAAAAECAwQFBgcICQoL/8QAtREA\nAgECBAQDBAcFBAQAAQJ3AAECAxEEBSExBhJBUQdhcRMiMoEIFEKRobHBCSMzUvAVYnLRChYk\nNOEl8RcYGRomJygpKjU2Nzg5OkNERUZHSElK