leted"},"tags":[]},"outputs":[],"source":["d_1 <- data.table(read_excel(input_file, sheet = \"T1\"))\n","d_2 <- data.table(read_excel(input_file, sheet = \"T2\"))\n","d_3 <- data.table(read_excel(input_file, sheet = \"T3\"))\n","d_4 <- data.table(read_excel(input_file, sheet = \"T4\"))\n","\n","d_2[,conn_source := \"AI\"]\n","d_2[,treatment := 0]\n","d_2[,group := 'U-W']\n","\n","d_1[,conn_source := \"PI\"]\n","d_1[,treatment := 1]\n","d_1[,group := 'A-W']\n","\n","d_3[,conn_source := \"LU\"]\n","d_3[,treatment := 2]\n","d_3[,group := 'A-M']\n","\n","d_4[,conn_source := \"AL\"] \n","d_4[,treatment := 3]\n","d_4[,group := 'U-M']\n","\n","names(d_1) <- names(d_2)\n","\n","d_3[, connected_date := as.POSIXct(connected_date, format = \"%d-%m-%Y\")]\n","d_4[, connected_date := as.POSIXct(connected_date, format = \"%d-%m-%Y\")]\n","\n","d <- rbind(d_1,d_2,d_3,d_4)\n","\n","# Clean Up\n","remove(d_1,d_2,d_3,d_4)\n","\n","#Rename Connection Names\n","d[, CONN2 := ifelse(CONN == '1.0','1',CONN)]\n","d[, connected := ifelse(CONN2 == '1',1,0)]\n","d[, connected := ifelse(is.na(connected),0,connected)] \n","\n","#Fill Gender\n","d[, gender := ifelse(is.na(gender),\"NA\",gender)] \n","\n","#MARK !processed connections\n","d[, complia := ifelse(OUT_DATE != '1-1-1900',1,0)]\n","d[, complia := ifelse(conn_source == 'LU',0,complia)]\n","d[, complia := ifelse(conn_source == 'AL',0,complia)]\n","\n","# Fix Dates\n","#d[,Conn_Req_Date := as.Date(as.integer(OUT_DATE), origin = \"1899-12-30\")]\n","\n","d[, OUT_DATE_clean := ifelse(grepl(\"^\\\\d+$\", OUT_DATE), OUT_DATE, NA)]\n","d[, Conn_Req_Date := as.Date(as.integer(OUT_DATE_clean), origin = \"1899-12-30\")]\n","\n","d[,Conn_Sent_Week := strftime(Connect_Date, format = \"%V\")]\n","d[connected == 1,connected_date_fix := as.Date(as.integer(connected_date), origin = \"1899-12-30\")]\n","d[,connection_lag := connected_date_fix - Conn_Req_Date ]\n","d[,cdc := Conn_Req_Date - as.Date(\"2021-03-05\")  ]\n","\n","#add ccon\n","setorder(d,Conn_Req_Date)\n","Connection_Dates <- d[complia == 1 & connected ==1,.N , by = .(Conn_Req_Date,treatment)]\n","Connection_Dates[, ccon := cumsum(N), by = .(treatment)]\n","d <- left_join(x=d,y=Connection_Dates,by = c(\"Conn_Req_Date\",'treatment'))\n","\n","# Remove Unused Columns\n","d[, ':=' (conn_source = NULL, \n","          Connect_Date = NULL, \n","          CONN2 = NULL, CONN = NULL, \n","          OUT_DATE = NULL, connected_date = NULL, N=NULL)]"]},{"cell_type":"markdown","id":"6b116dab","metadata":{"papermill":{"duration":0.021209,"end_time":"2024-10-11T10:01:15.593755","exception":false,"start_time":"2024-10-11T10:01:15.572546","status":"completed"},"tags":[]},"source":["### Experimental Design\n","\n","We conducted an audit study, where we created four fake profiles in LinkedIn, two identical women and two identical men, where the only difference was the profile picture. We searched on the web for attractive pictures for our attractive profiles, and used specialized image editing software to distort and “uglicize” the picture for our less attractive profiles. Our study applied a within-subjects, posttest only experiment, following a 2x2 factorial design, which structure can be summarized as in Table 1.\n","\n","2x2 Factorial Design"]},{"cell_type":"code","execution_count":5,"id":"943a12bb","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2024-10-11T10:01:15.640125Z","iopub.status.busy":"2024-10-11T10:01:15.638334Z","iopub.status.idle":"2024-10-11T10:01:15.669038Z","shell.execute_reply":"2024-10-11T10:01:15.667149Z"},"papermill":{"duration":0.056897,"end_time":"2024-10-11T10:01:15.671548","exception":false,"start_time":"2024-10-11T10:01:15.614651","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\n","Table: 2x2 Factorial Design\n","\n","|Profile            |Code |Assignment |Treatment |Measurement |\n","|:------------------|:----|:----------|:---------|:-----------|\n","|Attractive Woman   |A-W  |R          |X         |O           |\n","|Unattractive Woman |U-W  |R          |X         |O           |\n","|Attractive Man     |A-M  |R          |X         |O           |\n","|Unattractive Man   |U-M  |R          |X         |O           |"]},"metadata":{},"output_type":"display_data"}],"source":["L1 = c('R','R','R','R')\n","L2 = c('X','X','X','X')\n","L3 = c('Attractive Woman','Unattractive Woman','Attractive Man','Unattractive Man')\n","L4 = c('O','O','O','O')\n","L5 = c('A-W','U-W','A-M','U-M')\n","\n","kable(cbind(L3,L5,L1,L2,L4),caption = \"2x2 Factorial Design\",\n","        col.names = c('Profile',\"Code\",\"Assignment\",'Treatment','Measurement'),escape=FALSE)"]},{"cell_type":"markdown","id":"04dfa726","metadata":{"papermill":{"duration":0.02134,"end_time":"2024-10-11T10:01:15.713638","exception":false,"start_time":"2024-10-11T10:01:15.692298","status":"completed"},"tags":[]},"source":["### Participants\n","We sent a total of 1387 connection requests during 4 weeks of experiment, which ran between March, 5th 2021 and\n","April, 04 2021. 708 connection requests were sent for the attractive profile and 706 connection requests were sent for\n","the unattractive profile. The table below shows the pace of invites sent by day. Apart from the March 21st batch,\n","the pace of connection requests were reasonably similar among the profiles.\n"]},{"cell_type":"code","execution_count":6,"id":"c32df016","metadata":{"execution":{"iopub.execute_input":"2024-10-11T10:01:15.760217Z","iopub.status.busy":"2024-10-11T10:01:15.758391Z","iopub.status.idle":"2024-10-11T10:01:15.792308Z","shell.execute_reply":"2024-10-11T10:01:15.789931Z"},"papermill":{"duration":0.060722,"end_time":"2024-10-11T10:01:15.795459","exception":false,"start_time":"2024-10-11T10:01:15.734737","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\n","Table: Total connection requests by day for control (U-W) and treatment (A-W)\n","\n","|Date       | U-W| A-W|\n","|:----------|---:|---:|\n","|0       